import React from "react";
import "../footer/FooterSecond.css";
import support3 from "../images/support3.svg";
import logoWhite from "../images/logoWhite.png";
import location from "../images/location.png";

const FooterSecond = () => {
  return (
    <div id="contact" className="row d-flex footerMainNew">
      <div className="col-3">
        <img src={logoWhite} alt="whitelogo" />
        <h3 style={{ fontWeight: "lighter" }}>
          FIZMA<span style={{ fontWeight: "bold" }}>SOFT</span>
        </h3>
        <h6 className="text-align-center">IDEA IMPLEMENT RESULT</h6>
      </div>
      <div className="col-6">
        <div>Services</div>
        <div></div>
      </div>
      <div className="col-3">Our Location</div>
    </div>
  );
};

export default FooterSecond;
